API
    说明：该目录用于存放对外接口
目录内部结构
    根据不同的场景建立不同的文件夹。

建立不同地文件夹方便管理，将多个场景独立区分。

    文件夹内存放相应的Api信息。接口的调用采用 AXIOS 扩展。

采用axios原因
vue-resource已经停止维护

    文件夹内部分为main.js文件和URl.js文件。
    在main.js里编写主要主要函数方法相关函数的调用
import Url from './Url'
import Axios from 'axios'
export default {
  list () {
    return Axios.get(
      Url.GetTest.Url,
      {params: {
        cid: 50013008,
        pcid: 4
        }
    })
  }
}
    在URL.js文件中填入相关的接口地址。
export default {
  GetTest: {
    Url: 'http://office.e-corp.cn:8002/Offer_information/get_submarket',
    Method: 'GET'
    }
}
    目录结构如下
.
├── api
│   └── XXX
│       ├── Url.js
│       └── Main.js
